import React from "react";


const Footer = () => {
    return ( 
        <>
        <div className="mx-auto py-16 px-4 bg-[#71AC57]  z-10">
                    <p className="flex text-white"> Write to us <span>nasz e-mail</span></p>
                    <img className="bg-cover p-[20px] w-[70px] h-[70px] pt-5" src="./github.png" alt="" />              
        </div>
        </>
     );
}
 
export default Footer;
